                  "p_attributes": "{'Border': 'Tasselled', 'Fabric': 'Cotton Blend', 'Occasion': 'Daily', 'Ornamentation': 'Zari', 'Pattern': 'Dyed', 'Print or Pattern Type': 'Abstract', 'Sustainable': 'Sustainable', 'Technique': 'Tie and Dye', 'Wash Care': 'Hand Wash'}"
